import './Recipe.css'

import { useParams } from 'react-router-dom'
import { useFetch } from '../../hooks/useFetch'

export default function Recipe() {
  const {id} = useParams()
  const url = 'http://localhost:3000/recipes' + id
  const {error, isLoading, data: recipe} = useFetch(url)

  return (
    <div>Recipe</div>
  )
}
